import React from "react";
import { Link } from 'react-router-dom'
import Atendimentos from "../../layouts/Atendimentos";
import Prontuarios from "../../layouts/Prontuarios";
import AreaPaciente from "../../layouts/AreaPaciente";
import Agenda from "../../layouts/Agenda";
import Profissionais from "../../layouts/Profissionais";
import Servicos from "../../layouts/Servicos";
import SobreSistema from "../../layouts/Sobresistema";
import Rodape from "../../layouts/Rodape";
import '../../css/telaInicial.css';
import {
  FaHome,
  FaStethoscope,
  FaBookMedical,
  FaUser,
  FaCalendar,
  FaUserMd,
  FaBriefcaseMedical,
} from "react-icons/fa";


const TelaInicial: React.FC = () => {
  return (
      <div className= 'container'>
 <header>
 <div className=' interface'>

        <img src='blob:https://web.whatsapp.com/66ef9513-6e07-4cef-847c-b061d6ac17fa' className="App-logo" alt="logo" />

    <nav className='navigation-row'>
        <ul className='row'>
            <li><FaRegHospital /><a href= '#'>Home</a></li>
            <li><FaHandHoldingMedical /><a href= '#'>Atendimentos</a></li>
            <li><FaNotesMedical /><a href= '#'>Prontuários</a></li>
            <li><FaUser /><a href= '#'>Área do paciente</a></li>
            <li><FaRegCalendarAlt /><a href= '#'>Agenda</a></li>
            <li><FaUserMd /><a href= '#'>Profissionais</a></li>

        </ul>
    </nav>
    </div>

      </header>

      <SobreSistema />

      <section>

        <Atendimentos />
      </section>

      <section>

        <Prontuarios />
      </section>

      <section>

        <AreaPaciente />
      </section>

      <section>

        <Agenda />
      </section>

      <section>

        <Profissionais />
      </section>

      <section>

        <Servicos />
      </section>

      <Rodape />
    </div>
  );
};

export default TelaInicial;
